fn slice_field(f: Field, num_bytes: Field) -> (Field, Field) {
    // let path = get_path(num_bytes).map(|p: bool| p as Field);
    let chunks = __slice_field(f, num_bytes);

    chunks[0].assert_max_bit_size(8);
    chunks[1].assert_max_bit_size(16);
    chunks[2].assert_max_bit_size(32);
    chunks[3].assert_max_bit_size(64);
    chunks[4].assert_max_bit_size(128);
    // assert(path[0] + path[1] * 2 + path[2] * 4 + path[3] * 8 + path[4] * 16 == num_bytes);
    let mut head: Field = 0;
    let mut tail: Field = 0;

    // let mut head_multiplier: [Field; 4] = [0; 4];
    // let mut tail_multiplier: [Field; 4]= [0; 4];

    // head_multiplier[0] = path[4] * (two_pow_128 -1) + 1;
    // std::as_witness(head_multiplier[0]);
    // head_multiplier[1] = head_multiplier[0] * (path[3] * (two_pow_64 - 1)) + head_multiplier[0]; // two_pow_64 * path[3] + 1 - path[3]);
    // std::as_witness(head_multiplier[1]);
    // head_multiplier[2] = head_multiplier[1] * (path[2] * (two_pow_32 - 1)) + head_multiplier[1]; // (two_pow_32 * path[2] + 1 - path[2]);
    // std::as_witness(head_multiplier[2]);
    // head_multiplier[3] = head_multiplier[2] * (path[1] * (two_pow_16 - 1)) + head_multiplier[2]; // (two_pow_16 * path[1] + 1 - path[1]);
    // std::as_witness(head_multiplier[3]);

    // head = chunks[4] * path[4];
    // std::as_witness(head);
    // head += chunks[3] *  path[3] * head_multiplier[0];
    // std::as_witness(head);
    // head += chunks[2] *  path[2] * head_multiplier[1];
    // std::as_witness(head);
    // head += chunks[1] *  path[1] * head_multiplier[2];
    // std::as_witness(head);
    // head += chunks[0] *  path[0] * head_multiplier[3];
    let M = path_multipliers_chunk4[num_bytes];
    head = chunks[4] * M;
    std::as_witness(head);
    head += chunks[3] * path_multipliers_chunk3[num_bytes]; // path[3] * head_multiplier[0];
    std::as_witness(head);
    head += chunks[2] * path_multipliers_chunk2[num_bytes]; // path[2] * head_multiplier[1];
    std::as_witness(head);
    head += chunks[1] * path_multipliers_chunk1[num_bytes]; // path[1] * head_multiplier[2];
    std::as_witness(head);
    head += chunks[0] * path_multipliers_chunk0[num_bytes]; // path[0] * head_multiplier[3];

    // Mp4 + (1 - p4) = K
    // -K = -Mp4 + p4 - 1
    // -Mp4 + M + p4

    // -K + 1 + M
    // tail_multiplier[0] = two_pow_128 * (1 - path[4]) + path[4];
    // std::as_witness(tail_multiplier[0]);
    // tail_multiplier[1] = tail_multiplier[0] * (two_pow_64 * (1 - path[3]) + path[3]);
    // std::as_witness(tail_multiplier[1]);
    // tail_multiplier[2] = tail_multiplier[1] * (two_pow_32 * (1 - path[2]) + path[2]);
    // std::as_witness(tail_multiplier[2]);
    // tail_multiplier[3] = tail_multiplier[2] * (two_pow_16 * (1 - path[1]) + path[1]);
    // std::as_witness(tail_multiplier[3]);

    // println(f"tail_multiplier = {tail_multiplier}");
    // 
    tail = chunks[4] * (1 - M);
    std::as_witness(tail);
    tail += chunks[3] * tail_path_multipliers_chunk3[num_bytes]; // (1 - path[3]) * tail_multiplier[0];
    std::as_witness(tail);
    tail += chunks[2] * tail_path_multipliers_chunk2[num_bytes]; // * (1 - path[2]) * tail_multiplier[1];
    std::as_witness(tail);
    tail += chunks[1] * tail_path_multipliers_chunk1[num_bytes]; // * (1 - path[1]) * tail_multiplier[2];
    std::as_witness(tail);
    tail += chunks[0] * tail_path_multipliers_chunk0[num_bytes]; // * (1 - path[0]) * tail_multiplier[3];

    // println(f"head={head}, tail = {tail}");

    let total = tail + head * BYTE_SHIFT[num_bytes];
    assert(total == f);
    (head, tail)
}

#[test]
fn test_slice_field() {
    let input = 0xffeebbccbbaa99887766554433221100112233445566778899aabbccddeeff;

    let input_bytes: [u8; 32] = input.to_be_bytes(32).as_array();

    for i in 0..32 {
        println(f"i = {i}");
        let num_bytes = i as Field;
        let (head, tail) = slice_field(input, num_bytes);
        let mut expected_head: Field = 0;
        let mut expected_tail: Field = 0;
        for j in 0..num_bytes as u32 {
            expected_head *= 0x100;
            expected_head += input_bytes[j + 1] as Field;
        }
        for j in 0..(31 - num_bytes as u32) {
            expected_tail *= 0x100;
            expected_tail += input_bytes[j as Field + num_bytes + 1] as Field;
        }
        assert(expected_head == head);
        assert(expected_tail == tail);
    }
    let (head, tail) = slice_field(input, 11);
    let head_expected = 0xffeebbccbbaa9988776655;
    let tail_expected = 0x4433221100112233445566778899aabbccddeeff;
    assert(head_expected == head);
    assert(tail_expected == tail);
}

fn sum_var_bytes_into_field<let N: u32>(
    body_text: [u8; N],
    body_index: Field,
    num_bytes: Field
) -> Field {
    let path = get_path(num_bytes); // 5 gates
    let path_f: [Field; 5] = [path[0] as Field, path[1] as Field, path[2] as Field, path[3] as Field, path[4] as Field];

    //   println(f"path = {path}");
    // 3 gates (2 if we improve copy constraints in noir)
    assert(path_f[0] + path_f[1] * 2 + path_f[2] * 4 + path_f[3] * 8 + path_f[4] * 16 == num_bytes as Field);

    let mut idx: Field = body_index as Field;

    let mut chunks: [Field; 5] = [0; 5];

    chunks[0] = body_text[idx] as Field;
